import React from 'react';
import { Container } from 'react-bootstrap';
import './Style.css';

function ContentContainer({ navSelected }) {

    return (
        <Container id="content_container">
            <div id="home" className = "contentDivs">
                homepage
            </div>

            <div id="aboutme" className = "contentDivs">
                about me
            </div>
            <div id="education" className = "contentDivs">
                education
            </div>
            <div id="work" className = "contentDivs">
                work
            </div>
            
        </Container>
    );
}

export default ContentContainer;
